import { Fragment } from "react";

export default function Footer() {
  return (
    <Fragment>
      <footer className="py-1 bg-dark">
        <p className="text-center text-white mt-1">
          DHAcart - 2023-2024, All Rights Reserved
        </p>
      </footer>
    </Fragment>
  );
}
